import React from 'react';
import logo from '../images/logo.png';
import backgroundImage from '../images/background.jpg'; // Asegúrate de tener esta imagen

const Logo = () => {
  return (
    <div className="header-logo-container" style={{
      backgroundImage: `url(${backgroundImage})`,
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      height: '200px', // Ajusta esta altura según tus necesidades
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      position: 'relative'
    }}>
      <img 
        src={logo} 
        alt="logo" 
        className="header-logo-image" 
        style={{
          width: 'auto', // Cambiado de 100% a auto para mantener la proporción
          maxWidth: '80%', // Ajusta este valor según necesites
          maxHeight: '80%', // Asegura que el logo no sea más grande que el contenedor
          position: 'relative',
          zIndex: 1 // Asegura que el logo esté por encima del fondo
        }} 
      />
    </div>
  );
};

export default Logo;
